pragma solidity ^0.5.0;

contract MyContract {
    struct User {
        uint256 id;
        address referrer;
        uint256 personalMatrixId;
        uint256 field_512;
        uint256 field_768;
        uint256 field_1024;
        uint256 field_1280;
