    mapping(address => uint256[]) private positionsBy;
    mapping(uint256 => uint256) private binaryPositionsLevels;
    uint256 private lastUserId;
    uint256 private lastBinaryId;
    uint256 private lastPersonalMatrixId;
    address private owner;

    constructor(address _owner) public {
        owner = _owner;
    }

    function register(address referrer) public payable {
        require(msg.value == 0.1 ether, "Registration cost 0.1");
        require(!isUserExists(msg.sender), "User exists");
        require(referrer != address(0), "referrer not exists");

        lastUserId++;
        lastPersonalMatrixId++;

        User memory newUser;
        newUser.id = lastUserId;
        newUser.referrer = referrer;
        newUser.personalMatrixId = lastPersonalMatrixId;
        users[msg.sender] = newUser;
        usersById[lastUserId] = msg.sender;

